import React from "react";

export default function SentEmailsTable() {
  const data = [
    { to: "client@gmail.com", subject: "Welcome", status: "Sent" },
    { to: "hr@gmail.com", subject: "Resume", status: "Sent" },
  ];

  return (
    <div style={{ marginTop: 20 }}>
      <h3>Sent Emails</h3>
      <table border="1" width="100%">
        <thead>
          <tr>
            <th>To</th>
            <th>Subject</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, i) => (
            <tr key={i}>
              <td>{row.to}</td>
              <td>{row.subject}</td>
              <td>{row.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
